import React from 'react';
import { useNavigate } from 'react-router-dom';
import Card from './Card';

export default function SGODashboard() {
  const navigate = useNavigate();

  const addCSOPage = () => {
    navigate('/addCSO');
  }


  return (
    <main>
      <h1>SGO Dashboard</h1>
      <p>Welcome, SGO member! Here you can manage clubs, approve events, and view student activities.</p>
      <button onClick={addCSOPage}>Add CSO</button>

      
      <section className="d-flex justify-content-between">
        <Card 
          //image={clubImage}
          description="Students" 
        />
        <Card 
          //image={events}
          description="Executives" 
        />
        <Card 
          //image={collab}
          description="CSOs" 
        />
      </section>
    </main>
  );
}
